import React, {useState} from 'react';
import '../css/menu.css'

//Создаём меню
function Menu() {

    return(
        <div className="menu">
            <div className="menu__profile menu__select">Профиль</div>
            <div className="menu__search menu__select">Поиск</div>
            <div className="menu__objects menu__select">Объекты</div>
            <div className="menu__views menu__select">Просмотры</div>
            <div className="menu__documents menu__select">Документы</div>
        </div>
    )
}

export default Menu
